import React, { Component } from "react";
import CircleImage from "./CircleImage";

class ProfileSnapshot extends Component {
  state = {
    page: "Home",
    Home:"This image was taken at Roy's Peak in Wanaka, New Zealand.",

  };
  componentDidMount() {
    this.setState({ page: this.props.selected });
  }
  render() {
    return (
      <div
        style={this.props.style}
        className={`profile-snapshot flex-column ${this.props.profileDisplay}`}
      >
        <CircleImage
          imageId="headshot"
          imageSource="./images/me.jpg"
          size="90px"
        />
        <p>
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. Magni ex
          commodi nulla voluptatum numquam eaque nam, rem repellat nemo libero
          nihil inventore assumenda tempora eius vitae ratione excepturi
          molestias ipsum?
        </p>
      </div>
    );
  }
}
export default ProfileSnapshot;
